window.bookSummaryJSON = "<p><b>\"Narrator Rebecca Soler returns for the final installment in the Caraval trilogy... The magic, the fear, the betrayal, and especially the heartbreak are all magnified by her skillful narration. An intense listen that is hard to pause.\" — </b><b><i>AudioFile Magazine,</i></b><b> Earphones Award winner </b><br> <b><br> Welcome, welcome to </b><b><i>Finale</i></b><b>, the third and final audiobook in Stephanie Garber’s #1 </b><b><i>New York Times </i></b><b>bestselling Caraval series! <br> <br> </b>A love worth fighting for. A dream worth dying for. An ending worth waiting for.<br> <br> It’s been two months since the Fates were freed from a deck of cards, two months since Legend claimed the throne for his own, and two months since Tella discovered the boy she fell in love with doesn’t really exist.<br> <br> With lives, empires, and hearts hanging in the balance, Tella must decide if she’s going to trust Legend or a former enemy. After uncovering a secret that upends her life, Scarlett will need to do the impossible. And Legend has a choice to make that will forever change and define him.<br> <br> Caraval is over, but perhaps the greatest game of all has begun. There are no spectators this time: only those who will win, and those who will lose everything.<br> <br> Welcome, welcome to <i>Finale</i>. All games must come to an end…</p>"; 
